import React, { FC ,useState} from 'react';

type DailProps = {
  currentTemp: number;
  setTemp: number 
};

const Dail: React.FC<DailProps> = ({ currentTemp, setTemp }) => {
  return (
    <div style={{paddingBottom:'30px'}}>
    <Ellipse currentTemp={currentTemp} fill='#315B0F' setTemp={setTemp} radius={250 / (2 * Math.PI)} strokeWidth={6} />
    </div>
  );
};

interface EllipseProps {
  currentTemp: number;
  fill: string;
  radius: number;
  strokeWidth: number;
  setTemp: number;
}

interface ArchProps {
  radius: number;
  strokeWidth: number;
  strokeColor: string;
  startAngle: number;
  endAngle: number;
}

const Arch: FC<ArchProps> = ({ radius, strokeWidth, strokeColor, startAngle, endAngle }) => {
    const startX = radius * Math.cos((startAngle * Math.PI) / 180);
    const startY = radius * Math.sin((startAngle * Math.PI) / 180);
    const endX = radius * Math.cos((endAngle * Math.PI) / 180);
    const endY = radius * Math.sin((endAngle * Math.PI) / 180);
  // Create the path data for the full circle
  const pathData = `M ${startX} ${startY} A ${radius} ${radius} 0 1 1 ${endX} ${endY}`;

  return <path d={pathData} fill="none" stroke={strokeColor} strokeWidth={strokeWidth} strokeLinecap="round" />;
};

